export const mutations = {
  updateField,
  setFileContent(state, payload) {
    console.log("payload", payload);
    payload = JSON.parse(payload);
    for (const [key, value] of Object.entries(payload)) {
      console.log(key, value);
      state[key] = value;
    }
  },
  setImage(state, payload) {
    state.image = payload;
  },
  setSkillset(state, payload) {
    state.skillset = payload;
  },
  setLanguageset(state, payload) {
    state.languageset = payload;
  },
  setSections(state, payload) {
    state.sections = payload;
  },
  updateSection(state, payload) {
    state.sections[payload.index][payload.field] = payload.content;
  },
  moveSection(state, payload) {
    state.sections.splice(payload.to, 0, state.sections.splice(payload.from, 1)[0]);
  },
  addSection(state) {
    state.sections.push({ type: "SectionMeilensteine", title: "Work Experience", content: [] });
  },
  addMilestone(state, payload) {
    state.sections[payload.index].content.push({
      heading: "Heading",
      subheading: "Subheading",
      milestones: [],
    });
  },
  deleteMilestone(state, payload){
    const array = state.sections[payload.sectionIndex].content
    array.splice(payload.index,1)
  },
  updateMilestone(state, payload){
    state.sections[payload.sectionIndex].content[payload.index][payload.field] = payload.content
  },
  moveMilestone(state, payload){
    const array = state.sections[payload.sectionIndex].content
    array.splice(payload.to, 0, array.splice(payload.from, 1)[0]);
  },

  addStep(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.index].milestones
    array.push({date: 'Datum', title: 'Jobtitel', projects: []})
  },
  deleteStep(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones
    array.splice(payload.stepIndex,1)
  },
  updateStep(state, payload){
    state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones[payload.stepIndex][payload.field] = payload.content
  },
  moveStep(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones
    array.splice(payload.to, 0, array.splice(payload.from, 1)[0]);
  },

  addProject(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones[payload.stepIndex].projects
    array.push({heading: 'Project: Pricing Algorithm', text: 'Project Management'})
  },
  deleteProject(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones[payload.stepIndex].projects
    array.splice(payload.index,1)
  },
  updateProject(state, payload){
    state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones[payload.stepIndex].projects[payload.index][payload.field] = payload.content
  },
  moveProject(state, payload){
    const array = state.sections[payload.sectionIndex].content[payload.milestoneIndex].milestones[payload.stepIndex].projects
    array.splice(payload.to, 0, array.splice(payload.from, 1)[0]);
  },

};

